import ReactDOM from 'react-dom';
import logo from './logo.svg';
import './App.css';
import Albums from './Albums';



function App() {


  return (
    <div className="App">
     <div className="title">
       <span className='title-text'>
         { 'Gallery' }
       </span>
     </div>
      <Albums />
    </div>
  );
}

export default App;
